import React from "react";
import { Flex, Text, Icon } from "@chakra-ui/core";

const ProjectSettings = () => {
  return (
    <Flex>
      <img src="" />
      <Text>Web app</Text>
      <Icon name="chevron-down" />
    </Flex>
  );
};

export default ProjectSettings;
